import React from 'react';
import '../styles/Home.css';

const Home = () => {
  return (
    <section id="home">
      <header>
        <h1>Welcome to My Portfolio</h1>
        <h2>Building Innovative Solutions with Passion and Precision</h2>
      </header>
      <main>
        <p>
          I'm Mohammed Ikram Ashrafi, a Full-Stack Developer & DevOps Engineer with a passion for delivering high-quality solutions that exceed expectations.
        </p>
        <button>
          <a href="#about">Learn More About Me</a>
        </button>
      </main>
    </section>
  );
};

export default Home;
